class Services extends Component {
    render() {
        return (
                <Fragment>
                    <Container>
                        <Row>
                            <Col lg={4} md={6} sm={12}>
                            <h1>1</h1></Col>
                            <Col>
                            <h1>1</h1></Col>
                            <Col>
